import moment from "moment";
import { Link } from "react-router-dom";

const birthdayString = (data) => {
  return data.getDay();
}

function TableItem({ button, studentId, name, birthday }) {
  return (
    <tr>
      <td>
        <button>
          <Link
            to={{
              pathname: `/edit/${studentId}`,
              state: {
                studentId: studentId,
                name: name,
                birthday: birthday,
              },
            }}
          >
            {button}
          </Link>
        </button>
      </td>
      <td>
        <input type="checkbox" />
      </td>
      <td>
        <Link
          to={{
            pathname: `/detail/${studentId}`,
          }}
        >
          {studentId}
        </Link>
      </td>
      <td>{name}</td>
      <td>{bir}</td>
    </tr>
  );
}

export default TableItem;
